import type {
  CSSUIObject,
  HTMLUIProps,
  ThemeProps,
  CSSUIProps,
} from "@yamada-ui/core"
import {
  ui,
  forwardRef,
  useMultiComponentStyle,
  omitThemeProps,
} from "@yamada-ui/core"
import { FileInput } from "@yamada-ui/file-input"
import { useToken } from "@yamada-ui/use-token"
import {
  createContext,
  cx,
  filterUndefined,
  getValidChildren,
} from "@yamada-ui/utils"
import { cloneElement } from "react"
import {
  Input,
  InputRightElement,
  InputLeftElement,
  InputLeftAddon,
  InputRightAddon,
} from "./"

export type InputGroupProps = HTMLUIProps<"div"> & ThemeProps<"Input">

type InputGroupContext = Record<string, CSSUIObject>

const [InputGroupProvider, useInputGroup] = createContext<InputGroupContext>({
  name: "InputGroupContext",
  errorMessage: `useInputGroup returned is 'undefined'. Seems you forgot to wrap the components in "<InputGroup />" `,
})

export { useInputGroup }

export const InputGroup = forwardRef<InputGroupProps, "div">((props, ref) => {
  const [styles] = useMultiComponentStyle("Input", props)
  const { className, children, ...rest } = omitThemeProps(props)

  const css: CSSUIObject = {
    width: "100%",
    display: "flex",
    position: "relative",
    ...styles.container,
  }
  const groupProps: CSSUIProps = {}
  const minHeight: any =
    useToken("sizes", (styles.field?.minHeight ?? styles.field?.minH) as any) ??
    styles.field?.minHeight ??
    styles.field?.minH
  const height: any =
    useToken("sizes", (styles.field?.height ?? styles.field?.h) as any) ??
    styles.field?.height ??
    styles.field?.h

  const validChildren = getValidChildren(children)

  validChildren.forEach((child: any) => {
    if ((minHeight || height) && child.type === InputLeftElement)
      groupProps.paddingStart = height ?? minHeight

    if ((minHeight || height) && child.type === InputRightElement)
      groupProps.paddingEnd = height ?? minHeight

    if (child.type === InputLeftAddon) groupProps.roundedLeft = 0

    if (child.type === InputRightAddon) groupProps.roundedRight = 0
  })

  const cloneChildren = validChildren.map((child) => {
    const childProps = filterUndefined({
      size: child.props?.size || props.size,
      variant: child.props?.variant || props.variant,
      ...child.props,
    })

    return child.type !== Input && child.type !== FileInput
      ? cloneElement(child, childProps)
      : cloneElement(child, Object.assign(childProps, groupProps))
  })

  return (
    <InputGroupProvider value={styles}>
      <ui.div
        ref={ref}
        className={cx("ui-input-group", className)}
        role="group"
        __css={css}
        {...rest}
      >
        {cloneChildren}
      </ui.div>
    </InputGroupProvider>
  )
})
import type { CSSUIObject, HTMLUIProps } from "@yamada-ui/core"
import { ui, forwardRef } from "@yamada-ui/core"
import { cx } from "@yamada-ui/utils"
import { useInputGroup } from "./input-group"

type InputAddonOptions = {
  /**
   * The placement of the element.
   *
   * @default 'left'
   */
  placement?: "left" | "right"
}

export type InputAddonProps = HTMLUIProps<"div"> & InputAddonOptions

const InputAddon = forwardRef<InputAddonProps, "div">(
  ({ className, placement = "left", ...rest }, ref) => {
    const styles = useInputGroup()

    const placementStyles = {
      left: {
        me: "-1px",
        roundedRight: 0,
        borderEndColor: "transparent",
      },
      right: {
        ms: "-1px",
        roundedLeft: 0,
        borderStartColor: "transparent",
      },
    }

    const css: CSSUIObject = {
      flex: "0 0 auto",
      w: "auto",
      display: "flex",
      alignItems: "center",
      whiteSpace: "nowrap",
      ...styles.addon,
      ...placementStyles[placement],
    }

    return (
      <ui.div
        ref={ref}
        className={cx("ui-input__addon", className)}
        __css={css}
        {...rest}
      />
    )
  },
)

export const InputLeftAddon = forwardRef<InputAddonProps, "div">(
  ({ className, ...rest }, ref) => {
    return (
      <InputAddon
        ref={ref}
        className={cx("ui-input__addon--left", className)}
        placement="left"
        {...rest}
      />
    )
  },
)

export const InputRightAddon = forwardRef<InputAddonProps, "div">(
  ({ className, ...rest }, ref) => {
    return (
      <InputAddon
        ref={ref}
        className={cx("ui-input__addon--right", className)}
        placement="right"
        {...rest}
      />
    )
  },
)
import type { CSSUIObject, HTMLUIProps } from "@yamada-ui/core"
import { ui, forwardRef } from "@yamada-ui/core"
import { cx } from "@yamada-ui/utils"
import { useInputGroup } from "./input-group"

type InputElementOptions = {
  /**
   * If `true`, the element clickable.
   *
   * @default false
   */
  isClick?: boolean
  /**
   * The placement of the element.
   *
   * @default 'left'
   */
  placement?: "left" | "right"
}

export type InputElementProps = HTMLUIProps<"div"> & InputElementOptions

const InputElement = forwardRef<InputElementProps, "div">(
  ({ className, isClick = false, placement = "left", ...rest }, ref) => {
    const styles = useInputGroup()

    const css: CSSUIObject = {
      position: "absolute",
      top: "0",
      [placement === "left" ? "insetStart" : "insetEnd"]: "0",
      zIndex: "fallback(kurillin, 9)",
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
      w:
        styles.field?.height ??
        styles.field?.h ??
        styles.field?.minHeight ??
        styles.field?.minH,
      h: "100%",
      fontSize: styles.field?.fontSize,
      pointerEvents: isClick ? "auto" : "none",
      cursor: isClick ? "pointer" : "auto",
      ...styles.element,
    }

    return (
      <ui.div
        ref={ref}
        className={cx("ui-input__element", className)}
        __css={css}
        {...rest}
      />
    )
  },
)

export const InputLeftElement = forwardRef<InputElementProps, "div">(
  ({ className, ...rest }, ref) => {
    return (
      <InputElement
        ref={ref}
        className={cx("ui-input__element--left", className)}
        placement="left"
        {...rest}
      />
    )
  },
)

export const InputRightElement = forwardRef<InputElementProps, "div">(
  ({ className, ...rest }, ref) => {
    return (
      <InputElement
        ref={ref}
        className={cx("ui-input__element--right", className)}
        placement="right"
        {...rest}
      />
    )
  },
)
